{%- elif col in ['DrawingFile', 'InspDate'] %}
    {%- set file_key = 'DrawingFile' if col == 'DrawingFile' else 'InspReportFile' %}
    {%- set content = index ~ ' GA' if col == 'DrawingFile' else row[col] %}

    {%- if row[file_key] | length > 3 and row[col] != '' %}
        <td class="{{ col | lower }} url">
        {% for file in row[file_key].split(",") | reverse %}
            {% if loop.first %}
            <a href="{{ '/'.join([root, index, file.strip("[]' ")]) }}">{{ content }}</a>&nbsp
            {% if row[file_key].split(",") | length > 1 %}
            <button class="more-button" onclick="showHide(this)"> <i class="fa fa-plus"></i> </button> &nbsp
            {% endif %}
            {% else %}
            <a href="{{ '/'.join([root, index, file.strip("[]' ")]) }}" style="display:none">{{ file.strip("[]' ") | regex_replace }}</a> &nbsp
            {% endif %}
        {% endfor %}
        </td>
    {%- elif row[col] == 'nan' %}
        <td class="{{ col | lower }}"></td>
    {%- else %}
        <td class="noinspect">{{ content or 'not inspected' }}</td>
    {%- endif %}

