addition_expr: multiplication_expr
              | addition_expr '+' multiplication_expr
              | addition_expr '-' multiplication_expr ;

multiplication_expr: primary_expr
                    | multiplication_expr '*' primary_expr
                    | multiplication_expr '/' primary_expr ;

primary_expr: IDENTIFIER
             | NUMBER
             | '(' expr ')' ;

% Dérivée par rapport à x
d_signal_2D_x = diff(signal_2D, 1, 2);

% Dérivée par rapport à y
d_signal_2D_y = diff(signal_2D, 1, 1);

% Recherche des passages par zéro
contour_x = zeros(size(signal_2D));
contour_y = zeros(size(signal_2D));

% Passage par zéro pour la dérivée par rapport à x
for i = 1:size(d_signal_2D_x, 1)
    for j = 1:size(d_signal_2D_x, 2) - 1
        if d_signal_2D_x(i,j) * d_signal_2D_x(i,j+1) <= 0
            contour_x(i,j) = 1;
        end
    end
end

% Passage par zéro pour la dérivée par rapport à y
for i = 1:size(d_signal_2D_y, 1) - 1
    for j = 1:size(d_signal_2D_y, 2)
        if d_signal_2D_y(i,j) * d_signal_2D_y(i+1,j) <= 0
            contour_y(i,j) = 1;
        end
    end
end

% Combinaison des deux contours
contour = contour_x | contour_y;

