% Create a logical index for the hours between 21:00 and 06:00
zero_hours = (hour(A(:,2)) >= 21 | hour(A(:,2)) < 6);

% Loop through each unique date in the first column
for d = unique(floor(A(:,1)))
    % Find the rows corresponding to the current date and the zero hours
    idx = floor(A(:,1)) == d & zero_hours;
    % Set the cooling load to zero for those rows
    A(idx,3) = 0;
end

