- name: Gather Node Manager Port Mappings for Each Domain
  set_fact:
    nm_ports_per_domain: >-
      {{
        nm_ports_per_domain | default({}) | combine(
          { domain.key: domain.value.node_manager_port }
        )
      }}
  loop: "{{ hostvars[host].domains | dict2items }}"
  loop_control:
    loop_var: domain
  vars:
    host: "{{ item }}"
  when: "'domains' in hostvars[item]"
  loop: "{{ groups['host_servers'] }}"
  tags: [always]

- name: Map Unique IPs to Node Manager Port Mappings
  set_fact:
    ip_to_nm_ports: >-
      {{
        ip_to_nm_ports | default({}) | combine(
          { hostvars[item].ansible_host: nm_ports_per_domain }
        )
      }}
  loop: "{{ groups['host_servers'] }}"
  tags: [always]

- name: Gather Node Manager Port Mappings for Each Domain
  set_fact:
    nm_ports_per_domain: >-
      {{
        nm_ports_per_domain | default({}) | combine(
          { domain_item.key: domain_item.value.node_manager_port }
        )
      }}
  loop: "{{ groups['host_servers'] }}"
  vars:
    host: "{{ item }}"
  when: "'domains' in hostvars[host]"
  loop_control:
    loop_var: item
  tags: [always]

- name: Map Unique IPs to Node Manager Port Mappings
  set_fact:
    ip_to_nm_ports: >-
      {{
        ip_to_nm_ports | default({}) | combine(
          { hostvars[server_item].ansible_host: nm_ports_per_domain }
        )
      }}
  loop: "{{ groups['host_servers'] }}"
  loop_control:
    loop_var: server_item
  tags: [always]

- name: Gather Node Manager Port Mappings for Each Domain
  set_fact:
    nm_ports_per_domain: >-
      {{
        nm_ports_per_domain | default({}) | combine(
          { domain_info.key: domain_info.value.node_manager_port }
        )
      }}
  loop: "{{ lookup('dict', hostvars[host].domains).items() }}"
  vars:
    host: "{{ outer_item }}"
  when: "'domains' in hostvars[host]"
  loop_control:
    loop_var: domain_info
  tags: [always]
  loop: "{{ groups['host_servers'] }}"
  loop_control:
    extended: yes
    loop_var: outer_item

- name: Map Unique IPs to Node Manager Port Mappings
  set_fact:
    ip_to_nm_ports: >-
      {{
        ip_to_nm_ports | default({}) | combine(
          { hostvars[outer_item].ansible_host: nm_ports_per_domain }
        )
      }}
  loop: "{{ groups['host_servers'] }}"
  loop_control:
    loop_var: outer_item
  tags: [always]

- name: Gather Node Manager Port Mappings for Each Domain
  hosts: host_servers
  gather_facts: no
  tasks:
    - set_fact:
        nm_ports_per_domain: >-
          {{
            nm_ports_per_domain | default({}) | combine(
              {
                item.key: item.value.node_manager_port
              }
            )
          }}
      loop: "{{ lookup('dict', hostvars[inventory_hostname].domains) }}"
      loop_control:
        loop_var: item
      when: "'domains' in hostvars[inventory_hostname]"
      tags: [always]

