paste -d'\0' file1.txt file2.txt | awk '{
    line1 = $1
    line2 = $2
    result = ""
    for (i = 1; i <= length(line1); i++) {
        char1 = substr(line1, i, 1)
        char2 = substr(line2, i, 1)
        if (char1 ~ /[[:space:]]/ && char2 !~ /[[:space:]]/)
            result = result char2
        else
            result = result char1
    }
    print result
}'

